2 flaky tests are found using Nondex when running commands 
```mvn edu.illinois:nondex-maven-plugin:1.1.2:nondex Dtest=DynamoDBEncryptorTest#ensureEncryptedAttributesUnmodified``` 
and
```mvn edu.illinois:nondex-maven-plugin:1.1.2:nondex -Dtest=AttributeValueMarshallerTest#testSimpleMapWithNull```
The reason for test flakiness is that Java map API does not preserve the order of the key-value pairs. Comparing maps by casting to string can fail when, for example, the Java version upgrades in the future, or when the code is run in different environment.

**Flaky Tests and Fixes**
- Test:`ensureEncryptedAttributesUnmodified` in `DynamoDBEncryptor.java`.
   Reason & Fix: The test tries to compare two maps after casting them to strings. However, item orders in maps are not preserved.  I converted the referenced maps to TreeMaps before casting them to string.

- Test:`testSimpleMapWithNull` in `AttributeValueMarshallerTest.java`
   Reason & Fix: Part of the expected string is a representation of a map. Similarly, order is not preserved in maps, hence I considered the 2 possible permutation patterns of the string representation of the map.', 'created_at': '2022-02-07T12:05:53Z', 'updated_at': '2022-02-08T16:52:11Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': '5d642bf1ca3520e1994f195aba116c6a22c8c52e', 'assignee': None, 'assignees': [], 'requested_reviewers': [], 'requested_teams': [], 'labels': [], 'milestone': None, 'draft': False, 'commits_url': 'https://api.github.com/repos/aws/aws-dynamodb-encryption-java/pulls/274/commits', 'review_comments_url': 'https://api.github.com/repos/aws/aws-dynamodb-encryption-java/pulls/274/comments', 'review_comment_url': 'https://api.github.com/repos/aws/aws-dynamodb-encryption-java/pulls/comments{/number}', 'comments_url': 'https://api.github.com/repos/aws/aws-dynamodb-encryption-java/issues/274/comments', 'statuses_url': 'https://api.github.com/repos/aws/aws-dynamodb-encryption-java/statuses/4c281d4fafa4410087bc315d23eca8f23368431c', 'head': {'label': 'kaiyaok2:master', 'ref': 'master', 'sha': '4c281d4fafa4410087bc315d23eca8f23368431c', 'user': {'login': 'kaiyaok2', 'id': 47203510, 'node_id': 'MDQ6VXNlcjQ3MjAzNTEw', 'avatar_url': 'https://avatars.githubusercontent.com/u/47203510?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kaiyaok2', 'html_url': 'https://github.com/kaiyaok2', 'followers_url': 'https://api.github.com/users/kaiyaok2/followers', 'following_url': 'https://api.github.com/users/kaiyaok2/following{/other_user}', 'gists_url': 'https://api.github.com/users/kaiyaok2/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kaiyaok2/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kaiyaok2/subscriptions', 'organizations_url': 'https://api.github.com/users/kaiyaok2/orgs', 'repos_url': 'https://api.github.com/users/kaiyaok2/repos', 'events_url': 'https://api.github.com/users/kaiyaok2/even